import React from 'react';
import ReactDOM from 'react-dom';
import { withRouter, Link } from 'react-router-dom';
import 'antd/dist/antd.css';
import '../css/Test.css'
import { Menu } from 'antd';
const { SubMenu } = Menu;
const { Header } = Layout;

export default class Test extends React.Component {
  state = {
    current: 'mail',
  };

  handleClick = e => {
    console.log('click ', e);
    this.setState({
      current: e.key,
    });
  };

  render() {
    let menuItems;
    menuItems = [
          <Menu.Item>
            <Link to="/Home">Trang chủ</Link>
          </Menu.Item>,
          <Menu.Item>
            <Link to="/Test">Hướng dẫn</Link>
          </Menu.Item>,
          <Menu.Item>
            <Link to="/Test">Học C</Link>
          </Menu.Item>,
          <Menu.Item>
            <Link to="/Test">Bài kiểm tra</Link>
          </Menu.Item>,
          <Menu.Item>
            <Link to="/Test">Điểm</Link>
          </Menu.Item>
    ]
    return (
      <Header>
            <img src="../img/logo.png" alt="logo" height="40px"/>
            <Menu className="title-menu"
                    mode="horizontal"
                    style={{ lineHeight: '64px' }} >
                    {menuItems}
            </Menu>
      </Header>
    );
  }
}
